script: |
  super -f text -I q10725.spq | sort > q10725.out

inputs:
  - name: q10725.spq
    data: |
      SELECT ALL - + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + col1 - - 88 + + col2 NOT BETWEEN 25 / - + col2 * - 82 + - col1 AND NULL;
  - name: tab2

outputs:
  - name: q10725.out
    data: |
